        "content": {
            "text": "6.1 The Infuence of Environment and Viewpoint Count The study results show that the technique performed well in two tasks  in  one  environment  with  four  viewpoints.  Other  environ-ments and viewpoint counts might afect the performance of the technique. The implementation of the technique used in the study will likely translate poorly to certain types of environments. In visually com-plex environments that strive for realistic graphics and with many virtual objects, it will be more difcult to distinguish overlapping objects from diferent viewpoints due to visual occlusion. In an environment with lower visual complexity, more viewpoints can be distinguished. A visually complex environment can also support fewer viewpoints. However, even in a environment such as the one used in the study, there is an upper limit to the number of view-points that can be generated before the locations become difcult to distinguish (see Figure 11). The representation component of the technique can be adjusted to better accommodate diferent types of environments. The representation component of a viewpoint can be changed to intelligently flter the content instead of naïvely overlaying all ob-jects from each viewpoint. Building on data visualization concepts such as sampling lenses [12], a viewpoint could include only those virtual objects that are relevant for interaction, such as objects that can be selected and manipulated. While this would negatively afect the ability to spatially orient oneself in the environment, it would preserve the ability to preemptively orient oneself for interaction. Another approach to allow for visually complex environments or higher viewpoint counts could be to introduce a rank-order version of the technique. In a rank-order version, the level of opacity for a viewpoint is not static or binary, but changes gradually based on the computed usefulness of the viewpoint (similar to [29]). For ex-ample, an algorithm could infer a user’s intent to interact in a given viewpoint, similar to what is proposed for automated switching (see Section 6.2). That viewpoint could be given a higher opacity"
        },
