        "content": {
            "text": "We measure accuracy for each task, defned as the number of perspective switches used during a trial. We also measure the error rate for the two tasks, with an error in the monitoring task defned as clicking the button while not pointing at the target disc, and an error in the object collection task defned as releasing a coin without placing it in the chest within 5 seconds and without picking it up again. We also measure how much the participant moves their head within each trial as an expression of physical motion, which the OVRlap technique should ideally reduce due to its improved overview. To investigate the subjective experience and potential costs of using the technique, we include three measures. The technique introduces visual and conceptual complexity. It overlays multiple viewpoints and the user might see other instances of themselves at a distance based on the relative location of these viewpoints. This might afect both the user’s sense of being in a place from the overlapping locations, their sense of body ownership from seeing mirrored selves. The complexity might also afect the user’s overall experience of usability. Consequently, we assess presence, body ownership, and usability after each technique. We assess presence using the IPQ presence questionnaire [35], based on recommen-dations from recent work on measuring presence within VR envi-ronments [39]. We measure subjective usability using the System Usability Scale (SUS) [3, 9]. Lastly, to measure body ownership we use the VEQ body ownership questionnaire extended from Roth & Latoshik [36]. "
        },
