        "content": {
            "text": "4.3.2 Monitoring.  In monitoring, the participants need to hit a moving disc. This task is chosen to represent object selection wherein the use needs to locate a moving object and point at it to select it (Figure 7). In the task, a fat disc (50cm radius) will appear at one of the viewpoints at a time. The disc is vertically oriented, facing the view-point. The disc fies along a fgure-8 trajectory, with the diameter of each of the two circles in the fgure-8 trajectory being 2m. The trajectory also faces the viewpoint. The trajectories are centered two meters away and up from the viewpoint on one of four 90◦ increments around the viewpoint. These trajectories are designed to ensure a wide variety of potential positions for the discs. The disc moves forward on its trajectory at a speed of 1 m/s. The participant has a thin ray pointing out in a straight line from their right hand. The participant is tasked with changing their viewpoint to one at the location closest to the disc, pointing the ray at the disc as quickly as possible, and pulling the trigger on their controller. On a success, another disc appears at a random viewpoint and orientation, starting at a random point on the fgure-8 trajectory. This randomization is constant across techniques and participants. "
        },
